'From Squeak2.7 of 5 January 2000 [latest update: #1780] on 13 January 2000 at 9:37:05 am'!!SystemDictionary methodsFor: 'sources, change log' stamp: 'di 1/13/2000 09:36'!lastUpdateString	"Smalltalk lastUpdateString"	| aNumber |	aNumber _ ChangeSorter highestNumberedChangeSet.	^ (aNumber notNil and: [aNumber > 0])		ifTrue:			['latest update: #', aNumber printString]		ifFalse:			['No updates present.']! !